  {
    SELECT DISTINCT ?lang WHERE {
      <Lorelei> <hasLanguages> ?lang .
      ?lang a <Language> .
    }
  }
  # Collect languages spoken by sirens
  {
    SELECT DISTINCT ?lang2 WHERE {
      ?siren a <SIREN> .
      ?siren <hasLanguages> ?lang2 .
      ?lang2 a <Language> .
    }
  }

  # check no language in Lorelei's set missing in sirens' set
  FILTER NOT EXISTS {
    ?lang a <Language> .
    <Lorelei> <hasLanguages> ?lang .
    FILTER NOT EXISTS {
      ?siren a <SIREN> .
      ?siren <hasLanguages> ?lang .
    }
  }
  # check no language in sirens' set missing in Lorelei's set
  FILTER NOT EXISTS {
    ?siren a <SIREN> .
    ?siren <hasLanguages> ?lang .
    FILTER NOT EXISTS {
      <Lorelei> <hasLanguages> ?lang .
    }
  }
}

